input = DATA.read.chomp

regex = ('a'..'z').map do |c|
  "#{c}#{c.upcase}|#{c.upcase}#{c}"
end.join('|')
regex = Regexp.new("(#{regex})")

def reduce(polymer, regex)
  len = polymer.length
  loop do
    polymer.gsub!(regex, '')
    break if polymer.length == len
    len = polymer.length
  end
  len
end

len = reduce(input.dup, regex)
puts len

('a'..'z').each do |c|
  polymer = input.dup
  polymer.delete!(c + c.upcase)
  l = reduce(polymer, regex)
  len = l if l < len
end
puts len

__END__

